import React from 'react'
import { Link } from 'react-router-dom';

export default function Navbar() {
    return (
            <ul className='m-0 p-0 overflow-hidden bg-slate-900 text-white fixed'>
                <button className='float-left'><Link to={"/books"} className="block text-center px-5 hover:bg-slate-800">Home</Link></button>
            </ul>
    )
}
